    },
    {
        label:'Arabic',
        value:'ar'
    },
    {
        label:'Hindi',
        value:'hi'
    }
]

const Translate=()=>{
    const [language,setLanguage]=useState(options[0]);
    return(<div>
        <Dropdowm options={options}
        selected={language}
        onSelectChange={setLanguage}
        Title={"Select a Language"}/>
    </div>);
}
